import React from "react";

function Login({ onLogin }) {
  return (
    <div>
      <h2>Sign up</h2>
      <form>
        <input type="email"/>
        <button type="submit" className="button button_save popup__input">
          {buttonText}
        </button>
      </form>
      <button className="button button_close" onClick={onClose}></button>
    </div>
  );
}

export default Login;
